describe('Table column resizing validation after merge cell with selection', () => {
    let editor: DocumentEditor = undefined;
    beforeAll((): void => {
        let ele: HTMLElement = createElement('div', {
            id: 'container',
            styles: 'width:1280px;height:500px'
        });
        document.body.appendChild(ele);
        editor = new DocumentEditor({ enableEditor: true, enableSelection: true, isReadOnly: false });
        DocumentEditor.Inject(Editor, Selection, EditorHistory); editor.enableEditorHistory = true;
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
        editor.open(JSON.stringify(table));
    });
    afterAll((done): void => {
        editor.destroy();
        editor = undefined;
        document.body.removeChild(document.getElementById('container'));
        document.body.innerHTML = '';
        setTimeout(function () {
            done();
        }, 1000);
    });
    it('resizer position at 1 with selection', () => {
console.log('resizer position at 1 with selection');
        let prevPrefferedWidth: number = editor.selection.start.paragraph.associatedCell.cellFormat.preferredWidth;
        editor.editor.tableResize.resizerPosition = 1;
        editor.editor.tableResize.currentResizingTable = editor.selection.start.paragraph.associatedCell.ownerTable;
        editor.editorModule.tableResize.resizeNode = 1;
        editor.selection.handleDownKey();
        editor.selection.handleDownKey();
        editor.selection.handleShiftDownKey();
        editor.selection.handleShiftDownKey();
        editor.editorModule.tableResize.startingPoint.x = 171.366;
        editor.editorModule.tableResize.startingPoint.y = 197;
        editor.editor.tableResize.resizeTableCellColumn(20);
        expect(editor.selection.start.paragraph.associatedCell.cellFormat.preferredWidth).toBeCloseTo(prevPrefferedWidth + 20);
    });
    it('restrict table resizer in protected document', () => {
console.log('restrict table resizer in protected document');
        editor.openBlank();
        editor.editor.insertText('Hello world');
        editor.selection.extendToWordStart();
        editor.editor.insertEditRangeElement('Everyone');
        editor.selection.handleHomeKey();
        editor.editor.handleEnterKey();
        editor.editor.insertTable(2, 2);
        editor.editor.protect('ReadOnly');
        editor.editorModule.tableResize.currentResizingTable = editor.documentHelper.pages[0].bodyWidgets[0].childWidgets[1] as TableWidget;
        editor.editorModule.tableResize.resizeNode = 0;
        editor.documentHelper.isRowOrCellResizing = true;
        editor.editorModule.tableResize.resizerPosition = 1;
        editor.editorModule.tableResize.startingPoint = new Point(1075, 124);
        editor.editorModule.tableResize.resizeTableCellColumn(500.5);
        expect(((editor.selection.tableFormat.table.childWidgets[0] as TableRowWidget).childWidgets[0] as TableCellWidget).cellFormat.cellWidth).toBe(468);
    });
});
